import { useEffect, useState } from "react";


function SearchResults() {

    const [error, setError] = useState(null);
    const [didSearchResultsLoad, setDidSearchResultsLoad] = useState(false);
    const [searchResults, setSearchResults] = useState([]);

    useEffect(() => {
        fetch("http://421ac9951e5a.ngrok.io/search")
            .then(res => res.json())
            .then(
                (result) => {
                    setDidSearchResultsLoad(true);
                    setSearchResults(result);
                },
                // Note: it's important to handle errors here
                // instead of a catch() block so that we don't swallow
                // exceptions from actual bugs in components.
                (error) => {
                    setDidSearchResultsLoad(true);
                    setError(error);
                }
            )
    }, [])

    if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!didSearchResultsLoad) {
        return <div>Loading...</div>;
      } else {
        return (
          <ul>
            {searchResults.Quotes.map(item => (
              <li key={item.QuoteId}>
                {item.Carriers[0].Name} {item.Quotes.MinPrice}
              </li>
            ))}
          </ul>
        );
      }


}

export default SearchResults;
